import { t } from 'i18next'
import './search.css'
import SearchCardboard from './searchcardboard.js'

export default function Search(props) {

    return (
        <div onClick={() => props.clickHandler()} className="cardboard">
            <br />
            <br />
            <br />
            <br />
            <span style={{fontSize:"2.5em"}}>{t('appPageTexts.part5')}</span>
            <SearchCardboard />
        </div>
    );
}
